import React from 'react';
import styled from "styled-components";

export const LoginContainer = styled.div`
  display: flex;
  flex-direction: column;
  /* justify-content: center; */
  align-items: center;
  text-align: center;
  width: 360px;
  height: 90%;
  border-radius: 30px;
  background-color: #f9f9f9;
  box-shadow: 0px 0px 20px #d5d5d5;
  padding: 2px; 
  position: fixed;
  bottom: 0;
`;

export const LoginTitle = styled.div`
  margin-top: 40px;
  color : #636363;
  font-family: Nanum Barun Gothic;
  font-size : 40px;
  font-weight: bold;
`;

export const LoginIdInput = styled.input`
  width: 240px;
  height: 50px;
  border-radius: 20px;
  border: 2px solid #eeeeee;;
  /* box-shadow: 0px 0px 10px #e8e7e7; */
  background-color: #f9f9f9;
  padding: 2px; 
  margin: 15px;
  display: flex;
  align-items: center;
  justify-content: center;
  line-height: 50px;
  text-align: center;
  color : #cdcdcd;
  font-family: Nanum Barun Gothic;
  font-size : 15px;
  font-weight: bold;
`;

const Login = () => {
  return (
    <LoginContainer>
      <LoginTitle>LOGIN</LoginTitle>
      <LoginIdInput placeholder="your username here.."/>
    </LoginContainer>
  );
};

export default Login;
